export const FETCH_LOGIN = 'FETCH_LOGIN';

export const login = () =>{
        let url = 'http://127.0.0.1:8000/api/login';
        fetch(url)
        .then((res) =>{
            return res.json();
        }) 
        .then((data) =>{
            console.log(data);
        })
        .catch((error)=>{
            console.log(error);
        });  
 }
